      navigat('/Cart')
    }
    return (
        <div className='don'>
            <div className='pink'>
            
            <button className="" onClick={arrowee}>&lt;</button>
              <span className='war'>Deliver To</span>
              <img src="./asset/Group (2).png" alt="pi" className='jkl' />
            </div>
            <div className='bnm'>
                <button className='by'>upcoming</button>
                <button>History</button>
            </div>
        </div>
    )
}

export default Orders
